ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento n. 5/2022, pela Deputada Silvia Cristina (PDT-RO), que: "Requer, ouvido o plenário dessa Comissão a realização de 'Audiência Pública para discutir a aquisição, distribuição, controle e gestão dos medicamentos de câncer no Brasil', com os seguintes convidados: I. Representante do Ministério da Saúde; II. Representante do Instituto Lado a Lado;
III. Representante do Instituto Oncoguia; IV. Representante do Instituto Força do Amor;
V. Represente da Abrale; VI. Representantes da Sociedade Técnica Especializada; VII. Representantes da Sociedade Médica; VIII. Representantes do Setor Industrial; IX. Representante da Sociedade Brasileira de Oncologia Clínica - SBOC".

Apresentação do Requerimento n. 6/2022, pela Deputada Silvia Cristina (PDT-RO), que: "Requer, ouvido o plenário dessa Comissão a realização de Eventos, como exposição, diagnóstico e educação, para o combate ao câncer no Brasil, na Semana do Câncer, com os seguintes convidados: I. Representante do Ministério da Saúde; II. Representante do Instituto Lado a Lado;
III. Representante do Instituto Oncoguia; IV. Representante do Instituto Vencer o Câncer; V. Representante do Instituto Força do Amor; VI. Represente da Abrale
VII. Representantes da Sociedade Técnica Especializada; VIII. Representantes da Sociedade Médica; IX. Representantes do Setor Industrial; X. Representante da Sociedade Brasileira de Oncologia Clínica - SBOC; XI. Representante do Hospital de Amor".

Apresentação do Requerimento n. 4/2022, pelas Deputadaas Adriana Ventura (NOVO-SP) e outros, que: "Requer a inclusão, em Audiência Pública para tratar sobre a Agenda 227, do Instituto Alana, constante do Requerimento nº 3/2022, dos seguintes convidados: 
1) Representante da Fundação Maria Cecília Souto Vidigal;
2) Representante da rede Nacional da Primeira Infância - RNPI;
3) Representante da Coalizão Nacional pelos direitos de crianças, adolescentes e jovens sob orfandade da Covid-19.
".

Apresentação do Requerimento de Audiência Pública n. 2/2022, pelas Deputadas Vivi Reis (PSOL-PA) e Joenia Wapichana (REDE-RR), que: "Requer a realização de audiência pública para discutir as condições de trabalho e os direitos dos servidores da Funai que atualmente atuam nas Frentes de Proteção Etnoambiental encarregadas da execução da política indigenista voltada a Povos Indígenas Isolados e de Recente Contato e regulamentação/reconhecimento do trabalho desempenhado por sertanistas e indígenas com vínculos empregatícios temporários com a Funai, com a presença dos seguintes convidados:
1. Representante da União dos Povos Indígenas do Vale do Javari (Univaja);
2. Representante do Sindicato dos Servidores Públicos Federais no DF (Sindsep-DF);
3. Representante do Observatório dos Direitos Humanos dos Povos Indígenas Isolados e de Recente Contato (Opi);
4. Representante da Articulação dos Povos Indígenas do Brasil (Apib); e
5. Sra. Mislene Metchacuna Martins Mendes, Servidora da Funai no Valendo Javari".

Apresentação do Requerimento de Audiência Pública n. 3/2022, pelas Deputadaas Joenia Wapichana (REDE-RR) e outros, que: "Requer a realização de audiência pública para ouvir familiares, especialistas, indigenistas sobre estudos, pesquisas feitas no e sobre o Vale do Javari para elaborar subsídios para o relatório da Comissão, com a preseça dos seguintes convidados:
1 Pesquisadores da Universidade Federal do Pará;
2 Pesquisadores da Universidade Federal do Amazonas;
3 - Alessandra Sampaio - Esposa do Dom Philips; e
4 Beatriz Matos - Esposa de Bruno Pereira. 
".

Apresentação do Requerimento de Audiência Pública n. 5/2022, pelas Deputadaas Joenia Wapichana (REDE-RR) e outros, que: "Requer a realização de audiência pública para ouvir as lideranças indígenas e indigenistas sobre as ações desenvolvidas na região da Terra Indígena Vale do Javari e as denúncias já enviadas para as autoridades e que podem ter relação com o assassinato do indigenista Bruno Pereira e do jornalista Dom Phillips, com a presença dos seguintes convidados:
1 Quatro Representantes da União dos Povos Indígenas do Vale do Javari - UNIJAVA;
2 Um Representante a Coordenação das Organizações Indígenas da Amazônia Brasileira - COIAB;
3 Um Representante do Observatório dos Direitos Humanos dos Povos Indígenas Isolados e de Recente Contato - OPI; 
4 Um Representante da Articulação dos Povos Indígenas do Brasil - APIB; e
5 Um Representante do Indigenistas Associados - INA".

Apresentação do Requerimento de Audiência Pública n. 6/2022, pelas Deputadaas Joenia Wapichana (REDE-RR) e outros, que: "Requer a realização de audiência pública para ouvir as autoridades sobre as ações desenvolvidas na região da Terra Indígena Vale do Javari e as investigações sobre o assassinato do indigenista Bruno Pereira e do jornalista Dom Phillips, com a presença dos seguintes convidados:
1 Ministério da Justiça e Segurança Pública;
2 Diretor da Polícia Federal;
3 Presidente da Fundação Nacional do Índio;
4 Ministério Público Federal;
5 Instituto Brasileiro do Meio Ambiente e dos Recursos Naturais Renováveis;
6 Conselho Nacional da Amazônia;
7 Ministério da Defesa; e
8 Defensoria Pública da União".

Apresentação do Requerimento n. 1/2022, pelo Deputado Joaquim Passarinho (PL/PA), que "Requer realização de reunião de audiência pública com instituições de governo ligadas ao setor mineral para aperfeiçoamento do Código de Mineração, com a participação das seguintes
instituições:
 Ministério de Minas e Energia;
Ministério do Meio Ambiente;
Agência Nacional de Mineração – ANM;
Serviço Geológico do Brasil – CPRM;
Instituto Brasileiro do Meio Ambiente e dos Recursos Naturais Renováveis – Ibama;
Instituto Chico Mendes de Conservação da Biodiversidade –
ICMBio; e
Associação dos Municípios Mineradores de Minas Gerais e do Brasil – AMIG".
